description:
Ground truth mapping index names to document relevance scores.
Structure: { indexName: { docId: relevanceScore } }
Higher scores indicate more relevant documents.
Example: { "my-index": { "doc_A": 1, "doc_B": 2 }, "other-index": { "doc_C": 1 } }
